import React from 'react';
import { useNavigate } from 'react-router-dom'; // Importation de useNavigate
import './HomePage.css';
import im2 from './image2.jpg';
import insc from './inscription.jpg';
import rend from './rendez-vous.jpg';
import don from './don.jpg';
import cube from './cube.png';

const HomePage = () => {
  const navigate = useNavigate(); // Création du hook navigate

  const handleNavigate = () => {
    navigate('/signup'); // Redirection vers la page Signup
  };

  return (
    <div>
      {/* Navbar */}
      <nav className="navbar">
        <div className="logo">Logo</div>
        <div className='hhh'>
          <ul>
            <li> <a href="acc">Accueil</a></li>
            <li><a href="Services">Services</a></li>
            <li><a href="À propos">À propos</a></li>
            <li><a href="Contact" onClick={handleNavigate}>Contact</a></li> {/* Redirection sur le lien Contact */}
            <button className="nav-button" onClick={handleNavigate}>Rejoindre</button> {/* Redirection sur le bouton Rejoindre */}
            <button className="nav-button" onClick={handleNavigate}>S'inscrire</button> {/* Redirection sur le bouton S'inscrire */}
          </ul>
        </div>
      </nav>

      {/* Hero Section */}
      <div className="hero">
        <div className="hero-content">
          <h1>
            Sauvez des vies, <br /> donnez votre sang
          </h1>
          <p>
            Chaque don de sang peut sauver jusqu’à trois vies. Rejoignez-nous
            dans cette noble cause et faites la différence aujourd’hui.
          </p>
          <button className="cta-button" onClick={handleNavigate}>S'inscrire</button> {/* Redirection sur le bouton S'inscrire */}
        </div>
      </div>
      
    {/* Reste du contenu */}
    </div>
  );
};

export default HomePage;
